import React, { Component } from 'react';
import Header from '../../components/main_page/header/Header';
import './admin_page.css';
import AdminLayout from './../../components/main_page/UserHome';
import Image from '../../images/img_avatar.png';

class AdminPage extends Component {
    render() {
        return (
            <div className="">
                {/*Uses a series of props to load in users conent*/}
                <Header userName="Admin" userImage={Image}/>
                <AdminLayout />
            </div>
        );
    }
}

export default AdminPage;
